import '../../assets/styles/header.css'
import Particles from "react-tsparticles";
import {loadFull} from "tsparticles";

function Header() {
    return (
        <div>
            <Particles
                id="tsparticles"
                options={{
                    background: {
                        color: "rgb(10,10,25)",
                    },
                    fpsLimit: 60,
                }}
            />

            <header>
                Publish your ideas
            </header>
        </div>
    );
}

export default Header;
